import React from 'react'
import './App.css'
import script from './components/StarWars'

function App() {
  // Create object to place word-list in
  // Fetch data from source
  // Iterate over each word in list
  //    If word is new add word to object
  //    If word is repeated incremenet count for word
  // Print list of word bubbles in order of usage

  // MARK: Define text objects
  // TODO
  let words = {}
  let count = 0
  let newWord = ''

  // MARK: Get data
  // TODO

  // MARK: Iterate over words in list and place into new object
  for(const char of script) {
    // Saves me time
    count += 1
    if(count > 10000) {break}

    // Add string to new word until space
    if(char !== " ") {
      newWord += char.replace(/[.,\/#!$%\^&\*;:{}=\-_`~()\n 0-9]/g, "")
    } else {
      if(newWord.length > 1) {
        if(words[newWord]) {
          words
        }
        newWord = ''
      }
    }
  }

  // for(const word of words) {
  //   console.log(word)
  // }

  // Order words
  words.sort()
  console.log(words)  

  return (
    <h1>Hello world!</h1>
  )
}

export default App
